//@ts-nocheck
import '../styles/Global.css';
import Categories from '../components/Categories';

function App() {
  return (
    <div className="App">
      <h1>Head1</h1>
      <h2>Head2</h2>
      <h3>Head3</h3>
      <h4>Head4</h4>

      <button className="btn-1" type="button">Btn1</button>
      <button className="btn-2" type="button">Btn2</button>

      <p>Texto sin clase</p>
      <p className="txt-1">Txt1</p>
      <p className="txt-2">Txt2</p>

    </div>
  );
}

export default App;
